import React from 'react';


const Footer = () => {
    return (
        <>
            <footer className="row">
                <div className="col-md-4">
                    <h3>Information</h3>
                    <h5 className="text-text-decoration-none"><a href="">About Us</a></h5>
                    <h5 className=""><a href="">Delivery Information</a></h5>
                    <h5 className=""><a href="">Terms and Condiotions</a></h5>
                    <h5 className=""><a href="">Return Policy</a></h5>
                </div>
            </footer>
        </>
    )
}

export default Footer;
